import './App.css';
import HomeScreen from "./HomeScreen";
import {BrowserRouter, Route, Routes} from "react-router-dom";

function App() {
  return (
    <div className="container-fluid">
        <BrowserRouter>
            <Routes>
                <Route path="/" element={HomeScreen}></Route>
            </Routes>
        </BrowserRouter>

    </div>
  );
}

export default App;
